import React from "react";
import Header from "./components/header";
class App extends React.Component {
  state = {
    cartActivited: false,
  };
  render() {
    return (
      <React.Fragment>
        <Header />
        <h1>مشروع بناء متجر الكتروني</h1>
      </React.Fragment>
    );
  }
}

export default App;
